var tipuesearch = {"pages": [{'title': 'About', 'text': 'https://github.com/Corn723/cad2023 \n \n https://s1511.cycu.org/~cad41123135/cad2023 \n', 'tags': '', 'url': 'About.html'}, {'title': '課程總結', 'text': '( ✔ )A: 是否按照進度明確標示倉儲的改版歷程 \n (✔)B: 是否根據 \xa0 IPv4 與 IPv6 \xa0 網路環境設定進行作法討論 \n (✔)C: 是否就 \xa0 Replit、s.cycu.org 與 localhost \xa0 情境下對個人與分組倉儲進行設定操作\xa0 \xa0 \xa0 \n (✔)D: 是否就所分配的 \xa0 CAD 套件 從安裝設定到繪圖提供內容參考 \n (✔)E: 是否使用所分配的 CAD 套件完成 專案一零組件繪圖 , 並提供零組件下載 \n (✔)F: 是否將自行繪製的專案一零組件 轉入 CoppeliaSim \n ( ✘ )G: 是否利用 \xa0 ZMQ Remote API Python \xa0 對專案一轉入的零組件設定感測器, 並進行 鋼球永動模擬 \n (✘)H: 是否實際操作 \xa0 Triangle 軌道系統 的鋼球永動模擬 \n (✔)I: 是否完成 W15 的平面雙 U 迴路上的 鋼球永動系統繪圖、轉檔與系統模擬 \n (✔)J: 是否使用所分配的 CAD 套件完成 專案二 1D 平台零組件繪圖 , 並提供零組件下載 \n (✘)K: 是否利用 \xa0 ZMQ Remote API Python \xa0 對專案二轉入的零組件設定感測器, 並進行鋼球永動模擬 \n (✘)L: 是否針對專案二的 1D 平台鋼球平衡系統所需的 \xa0 PID 控制理論 進行資料收集與 ChatGPT 對答 \n', 'tags': '', 'url': '課程總結.html'}, {'title': '座位排序程式', 'text': '', 'tags': '', 'url': '座位排序程式.html'}, {'title': '排序程式', 'text': '排序程式 \n # Brython code starts\nfrom browser import document, html\n \n# get output html location\nbrython_div = document["brython_div1"]\nbrython_div <= html.P(id="output_table")\n \n# Replace this line with the actual file content\nfile_content = open("https://mde.tw/cadnote/downloads/2a_w12_seat.txt").read()\n \n# Create a dictionary to store student numbers and seat numbers\nseat_map = {}\n \n# Process each line of the file content\nfor line in file_content.splitlines():\n    # Split each line using tabs\n    elements = line.split("\\t")\n \n    # If the line contains seat information\n    if len(elements) == 2 and "(" in elements[1]:\n        # Extract student number and seat information\n        stud_num = elements[0].strip()\n        seat_info = elements[1].strip()\n \n        # Add student number and seat information to the dictionary\n        seat_map[stud_num] = seat_info\n \n# Find the maximum row and column values\nmax_row = max(int(seat_info[1]) for seat_info in seat_map.values())\nmax_col = max(int(seat_info[3]) for seat_info in seat_map.values())\n \n# Initialize a 2D list to represent the seating arrangement\nseating_arrangement = [["空位"] * max_col for _ in range(max_row)]\n \n# Populate the seating arrangement with student information\nfor stud_num, seat_info in seat_map.items():\n    row = int(seat_info[1]) - 1\n    col = int(seat_info[3]) - 1\n    seating_arrangement[row][col] = f"座位號: {seat_info}, 學號: {stud_num}"\n \n# Display the result in the HTML document\nresult_html = "<table>"\nfor row in seating_arrangement:\n    result_html += "<tr>"\n    for cell_content in row:\n        result_html += f"<td>{cell_content}</td>"\n    result_html += "</tr>"\nresult_html += "</table>"\n \n# Update the HTML content with the result\ndocument["output_table"].html = result_html\n# Brython code ends\n \n', 'tags': '', 'url': '排序程式.html'}, {'title': '執行結果', 'text': '\n \n \n 座位號: (1,1), 學號: 41123123 \n 座位號: (1,2), 學號: 41123119 \n 座位號: (1,3), 學號: 41123105 \n 座位號: (1,4), 學號: 41123152 \n 座位號: (1,5), 學號: 41123120 \n 座位號: (1,6), 學號: 41123108 \n 座位號: (1,7), 學號: 41123145 \n 座位號: (1,8), 學號: 41123137 \n 座位號: (1,9), 學號: 41123130 \n \n \n 座位號: (2,1), 學號: 41123140 \n 座位號: (2,2), 學號: 41123150 \n 座位號: (2,3), 學號: 41123124 \n 空位 \n 座位號: (2,5), 學號: 41136123 \n 座位號: (2,6), 學號: 41123148 \n 座位號: (2,7), 學號: 41123116 \n 座位號: (2,8), 學號: 41123146 \n 空位 \n \n \n 座位號: (3,1), 學號: 41123139 \n 座位號: (3,2), 學號: 41123131 \n 座位號: (3,3), 學號: 41123135 \n 座位號: (3,4), 學號: 41123149 \n 座位號: (3,5), 學號: 41123122 \n 座位號: (3,6), 學號: 41123134 \n 座位號: (3,7), 學號: 41123107 \n 座位號: (3,8), 學號: 41123101 \n 座位號: (3,9), 學號: 41123102 \n \n \n 座位號: (4,1), 學號: 41123128 \n 座位號: (4,2), 學號: 41123117 \n 座位號: (4,3), 學號: 41123114 \n 座位號: (4,4), 學號: 41123126 \n 座位號: (4,5), 學號: 41123115 \n 座位號: (4,6), 學號: 41123111 \n 空位 \n 座位號: (4,8), 學號: 41123112 \n 空位 \n \n \n 座位號: (5,1), 學號: 41123144 \n 座位號: (5,2), 學號: 41123141 \n 座位號: (5,3), 學號: 41123143 \n 座位號: (5,4), 學號: 41123129 \n 空位 \n 空位 \n 座位號: (5,7), 學號: 41023134 \n 座位號: (5,8), 學號: 41023156 \n 座位號: (5,9), 學號: 41023155 \n \n \n 座位號: (6,1), 學號: 40923118 \n 座位號: (6,2), 學號: 41123154 \n 座位號: (6,3), 學號: 41123153 \n 空位 \n 座位號: (6,5), 學號: 41023245 \n 座位號: (6,6), 學號: 41023246 \n 空位 \n 座位號: (6,8), 學號: 40923127 \n 座位號: (6,9), 學號: 40923213 \n \n \n', 'tags': '', 'url': '執行結果.html'}, {'title': '進度', 'text': '', 'tags': '', 'url': '進度.html'}, {'title': 'W4', 'text': '建立考試帳號 \n 利用replit把github更新並推送更新內容 \n 選用繪圖軟體( Solidworks ) \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W5', 'text': '學習使用 CoppeliaSim套件 \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '進行九人分組 \n 獲取CoppeliaSim展示用IPv6位址 \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '學習使用透過localhost方式更新github \n 獲取新的教室網路設定檔案 \n 開始繪製任務一零件 \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '學習使用自架主機維護網站 \n 第一次考試(考兩次，分數平均) \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '期中考(考兩次) \n', 'tags': '', 'url': 'W9.html'}, {'title': 'W10', 'text': '講解wink使用方法 \n', 'tags': '', 'url': 'W10.html'}, {'title': 'W11', 'text': '校慶運動會\xa0 \n', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '填位置座標 \n 並且按照位置排序出座位表 \n', 'tags': '', 'url': 'W12.html'}, {'title': 'W13', 'text': '考試點名 \n 其餘有聽沒有懂 \n', 'tags': '', 'url': 'W13.html'}, {'title': 'W14', 'text': '教師查看每組進度 \n 對每位學員網站進行評分 \n 教學 專案二 \n', 'tags': '', 'url': 'W14.html'}, {'title': 'W15', 'text': '考試 \n 做exam作業( 作業內容 )\xa0 \n 教師查看全班個人網站並評分 \n', 'tags': '', 'url': 'W15.html'}, {'title': 'W16', 'text': '考試 (75分) \n 新增課程總結 \n', 'tags': '', 'url': 'W16.html'}, {'title': 'W17', 'text': '', 'tags': '', 'url': 'W17.html'}, {'title': '任務一', 'text': '零組件檔案 \n \n', 'tags': '', 'url': '任務一.html'}, {'title': 'exam', 'text': '組員:41123149 蕭宇森 \n', 'tags': '', 'url': 'exam.html'}, {'title': '基本零組件繪圖', 'text': '圖檔 \n', 'tags': '', 'url': '基本零組件繪圖.html'}, {'title': 'HW', 'text': '', 'tags': '', 'url': 'HW.html'}, {'title': 'replit', 'text': '1.進入replit內自己的專案，並且RUN \n \n 2.在網址打上專案名稱.使用者名稱.repl.co，並且登入進去 \n \n 3.更新完並且按save \n \n 4.更新完轉靜態 \n \n 5.回replit進入git，並且輸入備註確認 \n \n 6.進行push \n \n \n', 'tags': '', 'url': 'replit.html'}, {'title': 's1511.cycu.org', 'text': '1.開啟ssh_cad學號.bat \n \n \n 2.輸入密碼(在自己的email有) \n \n 3.進入 cad2023 \n \n 4.輸入python3 server.py&(&是背景執行的意思)，他會給你一個你背景執行的編號 \n \n 5.成功執行，進入 https://s1511.cycu.org :分配到的外部 埠 號 \n \n 6.登入進去並且進行更新 \n \n 7.更新完轉靜態(convert)，按下acp並且輸入備註，把檔案推回github \n \n 8.完成更新 \n \n', 'tags': '', 'url': 's1511.cycu.org.html'}, {'title': 'Brython', 'text': 'https://en.wikipedia.org/wiki/Python_(programming_language) \n Examples: \n https://gist.github.com/mdecycu/d9082d678096bd58378d6afe2c7fa05d \n https://www.geeksforgeeks.org/python-programming-examples/ \n https://www.programiz.com/python-programming/examples \n https://www.freecodecamp.org/news/python-code-examples-sample-script-coding-tutorial-for-beginners/ \n Python Tutorial: \n https://docs.python.org/3/tutorial/ \n An informal introduction to Python \n Indentation (Python 採 4 個 Spaces 縮排, 以界定執行範圍) \n Variables ( Python Keywords ) \n Comments (# 單行註解, 三個單引號或三個雙引號標註多行註解) \n Numbers  (整數 int(), 浮點數 float()) \n Strings  (字串) \n print (Python 內建函式,  print()  函式) \n Python control flow tools \n for \n if \n range \n open \n read \n lists \n tuples \n dictionaries \n functions \n try ... except \n break \n pass \n classes \n 這個頁面 demo 如何在同一頁面下納入多個線上 Ace 編輯器與執行按鈕 ( practice_html.txt  動態頁面超文件). \n practice_html.txt  動態頁面超文件應該可以在啟動 Brython 時, 設定將 .py 檔案放入 downloads/py 目錄中引用. \n 亦即將所有對應的 html 也使用 Brython 產生, 然後寫為  class  後, 在範例導入時透過  instance  引用. \n <!-- 啟動 Brython -->\n<script>\nwindow.onload=function(){\nbrython({debug:1, pythonpath:[\'./../cmsimde/static/\',\'./../downloads/py/\']});\n}\n</script> \n 從 1 累加到 100: \n 1 add to 100 \n 將 iterable 與 iterator  相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. \n  導入 brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src1"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n \n \n \n  add 1 to 100 開始  \n \n \n  add 1 to 100 結束 \n  editor1 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n \n \n', 'tags': '', 'url': 'Brython.html'}]};